$code =~ s/\.\*/\*/g;
$code =~ s/\.\//\//g;
$code =~ s/\.\^/p/g;
$code =~ s/1\//1.\//g;
$code =~ s/p\(1\.\/2\)/sqrt/g;
$code =~ s/p\(1\.\/3\)/curt/g;
$code =~ s/p\(2\/3\)/cusq/g;

print $code;
print "---------------------------------------------------\n";

# Now lets do the hard part: (xxx)sqrt becomes sqrt(xxx).
while ($code =~ /\(/) {
  $code =~ s/\(([^()]+)\)(sqrt|curt|cusq|)/$2\[$1\]/g;
print $code;
print "---------------------------------------------------\n";
}
$code =~ s/\[/(/g;
$code =~ s/\]/)/g;

$code =~ s/(.)p2/($1*$1)/g;
$code =~ s/(.)p3/($1*$1*$1)/g;
$code =~ s/(.)p4/($1*$1*$1*$1)/g;
$code =~ s/(\d+)sqrt/sqrt($1)/g;
$code =~ s/(\d+)curt/curt($1)/g;
$code =~ s/(\d+)cusq/cusq($1)/g;

# attempt at further niceties
my @pwrs;
my %bits;
for my $v (qw/A B C D E/) {
  push @pwrs, "cplx $v$v = $v*$v;";
  push @pwrs, "cplx $v$v$v = $v$v*$v;";
  push @pwrs, "cplx $v$v$v$v = $v$v*$v$v;";
  $code =~ s/\($v\*$v\)/$v$v/g;
  $code =~ s/\($v\*$v\*$v\)/$v$v$v/g;
  $code =~ s/\($v\*$v\*$v\*$v\)/$v$v$v$v/g;
}

print $code;
print "---------------------------------------------------\n";

while ($code =~ /([ABCDE]+(\*[ABCDE]+)+)/) {
  my $grp = $1;
  my @srt = sort(split(/\*/,$grp));
  my $srts = join("",@srt);
  my $srtl = join("*",@srt);
  unless (exists($bits{$srts})) {
    $bits{$srts}=1;
    push @pwrs, "cplx $srts = $srtl;";
  }
$grp =~ s/\*/\\\*/g;
  print "group: $grp. srts: $srts. srtl: $srtl.\n";
  $code =~ s/\b$grp\b/$srts/g;
}

open OUT, ">solvep_m2c.cpp" or die;
print OUT "$_\n" for (@pwrs);
my $k=1;
for (split(/\n/,$code)) {
  print OUT "cplx x$k = $_;\n";
  $k++;
}
close OUT;
